INSERT INTO `item_info` VALUES ('54a73e65e779893a797fff22','Akbronco Prime Blueprint','The Akbronco Prime lowers  Impact damage to increase  Slash damage, while gaining increased firing rate, critical damage, status chance and magazine size. The Akbronco Prime was added into the game in Update 12.4.','http://warframe.wikia.com/wiki/Akbronco_Prime',NULL,0,2000,NULL,15,6),('54a73e65e779893a797fff23','Akbronco Prime Link','The Akbronco Prime lowers  Impact damage to increase  Slash damage, while gaining increased firing rate, critical damage, status chance and magazine size. The Akbronco Prime was added into the game in Update 12.4.','http://warframe.wikia.com/wiki/Akbronco_Prime',NULL,0,2000,NULL,45,6),('54a73e65e779893a797fff24','Ankyros Prime Blade','The Ankyros Prime are the primed version of Ankyros, added in Update 12.4.','http://warframe.wikia.com/wiki/Ankyros_Prime',NULL,0,2000,NULL,65,35),('54a73e65e779893a797fff25','Ankyros Prime Blueprint','The Ankyros Prime are the primed version of Ankyros, added in Update 12.4.','http://warframe.wikia.com/wiki/Ankyros_Prime',NULL,0,2000,NULL,15,35),('54a73e65e779893a797fff26','Ankyros Prime Gauntlet','The Ankyros Prime are the primed version of Ankyros, added in Update 12.4.','http://warframe.wikia.com/wiki/Ankyros_Prime',NULL,0,2000,NULL,15,35),('54a73e65e779893a797fff27','Bo Prime Blueprint','The Bo Prime is the primed variant of the Bo staff. It was added in Update 13.7, featuring higher damage and an additional  polarity.','http://warframe.wikia.com/wiki/Bo_Prime',NULL,5,2000,NULL,15,8),('54a73e65e779893a797fff28','Bo Prime Handle','The Bo Prime is the primed variant of the Bo staff. It was added in Update 13.7, featuring higher damage and an additional  polarity.','http://warframe.wikia.com/wiki/Bo_Prime',NULL,5,2000,NULL,45,8),('54a73e65e779893a797fff29','Bo Prime Ornament','The Bo Prime is the primed variant of the Bo staff. It was added in Update 13.7, featuring higher damage and an additional  polarity.','http://warframe.wikia.com/wiki/Bo_Prime',NULL,5,2000,NULL,15,8),('54a73e65e779893a797fff2a','Boar Prime Barrel','The Boar Prime is an ancient Orokin automatic shotgun that serves as an upgraded version of the Boar. The Boar Prime further improves on the strengths of the Boar, focusing on a high rate of fire, spread, and magazine capacity, on top of improving overall damage. This gives the Boar Prime extremely high damage per second, mitigated only by the short-comings of its predecessor, with its inability to effectively engage targets past short range. ','http://warframe.wikia.com/wiki/Boar_Prime',NULL,11,2000,NULL,45,109),('54a73e65e779893a797fff2b','Boar Prime Blueprint','The Boar Prime is an ancient Orokin automatic shotgun that serves as an upgraded version of the Boar. The Boar Prime further improves on the strengths of the Boar, focusing on a high rate of fire, spread, and magazine capacity, on top of improving overall damage. This gives the Boar Prime extremely high damage per second, mitigated only by the short-comings of its predecessor, with its inability to effectively engage targets past short range. ','http://warframe.wikia.com/wiki/Boar_Prime',NULL,11,2000,NULL,15,109),('54a73e65e779893a797fff2c','Boar Prime Receiver','The Boar Prime is an ancient Orokin automatic shotgun that serves as an upgraded version of the Boar. The Boar Prime further improves on the strengths of the Boar, focusing on a high rate of fire, spread, and magazine capacity, on top of improving overall damage. This gives the Boar Prime extremely high damage per second, mitigated only by the short-comings of its predecessor, with its inability to effectively engage targets past short range. ','http://warframe.wikia.com/wiki/Boar_Prime',NULL,11,2000,NULL,15,109),('54a73e65e779893a797fff2d','Boar Prime Stock','The Boar Prime is an ancient Orokin automatic shotgun that serves as an upgraded version of the Boar. The Boar Prime further improves on the strengths of the Boar, focusing on a high rate of fire, spread, and magazine capacity, on top of improving overall damage. This gives the Boar Prime extremely high damage per second, mitigated only by the short-comings of its predecessor, with its inability to effectively engage targets past short range. ','http://warframe.wikia.com/wiki/Boar_Prime',NULL,11,2000,NULL,100,109),('54a73e65e779893a797fff2e','Boltor Prime Barrel','The Boltor Prime is the prime variant of the Boltor rifle. Like its classic version, its bolts\' flight time require compensation, making this weapon more difficult to use at longer ranges, and requiring the user to lead targets for effectiveness. Despite this, the Boltor Prime can easily punish close-range targets with its high damage.','http://warframe.wikia.com/wiki/Boltor_Prime',NULL,13,2000,NULL,15,68),('54a73e65e779893a797fff2f','Boltor Prime Blueprint','The Boltor Prime is the prime variant of the Boltor rifle. Like its classic version, its bolts\' flight time require compensation, making this weapon more difficult to use at longer ranges, and requiring the user to lead targets for effectiveness. Despite this, the Boltor Prime can easily punish close-range targets with its high damage.','http://warframe.wikia.com/wiki/Boltor_Prime',NULL,13,2000,NULL,100,68),('54a73e65e779893a797fff30','Boltor Prime Receiver','The Boltor Prime is the prime variant of the Boltor rifle. Like its classic version, its bolts\' flight time require compensation, making this weapon more difficult to use at longer ranges, and requiring the user to lead targets for effectiveness. Despite this, the Boltor Prime can easily punish close-range targets with its high damage.','http://warframe.wikia.com/wiki/Boltor_Prime',NULL,13,2000,NULL,45,68),('54a73e65e779893a797fff31','Boltor Prime Stock','The Boltor Prime is the prime variant of the Boltor rifle. Like its classic version, its bolts\' flight time require compensation, making this weapon more difficult to use at longer ranges, and requiring the user to lead targets for effectiveness. Despite this, the Boltor Prime can easily punish close-range targets with its high damage.','http://warframe.wikia.com/wiki/Boltor_Prime',NULL,13,2000,NULL,15,68),('54a73e65e779893a797fff32','Braton Prime Barrel','The Braton Prime is an ancient Orokin assault rifle that serves as an upgrade of the Braton. It features higher base damage and magazine capacity compared to the standard Braton, at the cost of lower ammo reserves. The Braton Prime sports a higher ratio of  Slash damage than the basic Braton, though its  Impact damage is comparatively lower. Overall, the Braton Prime is a formidable weapon, and is considered to be a reasonable upgrade from the basic Braton.','http://warframe.wikia.com/wiki/Braton_Prime',NULL,8,2000,NULL,15,3),('54a73e65e779893a797fff33','Braton Prime Blueprint','The Braton Prime is an ancient Orokin assault rifle that serves as an upgrade of the Braton. It features higher base damage and magazine capacity compared to the standard Braton, at the cost of lower ammo reserves. The Braton Prime sports a higher ratio of  Slash damage than the basic Braton, though its  Impact damage is comparatively lower. Overall, the Braton Prime is a formidable weapon, and is considered to be a reasonable upgrade from the basic Braton.','http://warframe.wikia.com/wiki/Braton_Prime',NULL,8,2000,NULL,25,3),('54a73e65e779893a797fff34','Braton Prime Receiver','The Braton Prime is an ancient Orokin assault rifle that serves as an upgrade of the Braton. It features higher base damage and magazine capacity compared to the standard Braton, at the cost of lower ammo reserves. The Braton Prime sports a higher ratio of  Slash damage than the basic Braton, though its  Impact damage is comparatively lower. Overall, the Braton Prime is a formidable weapon, and is considered to be a reasonable upgrade from the basic Braton.','http://warframe.wikia.com/wiki/Braton_Prime',NULL,8,2000,NULL,45,3),('54a73e65e779893a797fff35','Braton Prime Stock','The Braton Prime is an ancient Orokin assault rifle that serves as an upgrade of the Braton. It features higher base damage and magazine capacity compared to the standard Braton, at the cost of lower ammo reserves. The Braton Prime sports a higher ratio of  Slash damage than the basic Braton, though its  Impact damage is comparatively lower. Overall, the Braton Prime is a formidable weapon, and is considered to be a reasonable upgrade from the basic Braton.','http://warframe.wikia.com/wiki/Braton_Prime',NULL,8,2000,NULL,15,3),('54a73e65e779893a797fff36','Bronco Prime Barrel','The Bronco Prime features a higher base damage and magazine size than the Bronco, at the cost of a lower fire rate and reload speed. The Bronco Prime was added into the game in Update 9.0.','http://warframe.wikia.com/wiki/Bronco_Prime',NULL,4,2000,NULL,45,84),('54a73e65e779893a797fff37','Bronco Prime Blueprint','The Bronco Prime features a higher base damage and magazine size than the Bronco, at the cost of a lower fire rate and reload speed. The Bronco Prime was added into the game in Update 9.0.','http://warframe.wikia.com/wiki/Bronco_Prime',NULL,4,2000,NULL,15,84),('54a73e65e779893a797fff38','Bronco Prime Receiver','The Bronco Prime features a higher base damage and magazine size than the Bronco, at the cost of a lower fire rate and reload speed. The Bronco Prime was added into the game in Update 9.0.','http://warframe.wikia.com/wiki/Bronco_Prime',NULL,4,2000,NULL,15,84),('54a73e65e779893a797fff39','Burston Prime Barrel','The Burston Prime is the prime variant of the Burston. Compared to its predecessor, the Burston Prime features higher damage across the board, and a slightly higher status chance, making it a direct upgrade from the standard Burston. Like the standard Burston, the Burston Prime features the signature three-round burst mechanic, making it difficult for some Tenno to use, but rewarding if one can learn the patterns.','http://warframe.wikia.com/wiki/Burston_Prime',NULL,12,2000,NULL,45,28),('54a73e65e779893a797fff3a','Burston Prime Blueprint','The Burston Prime is the prime variant of the Burston. Compared to its predecessor, the Burston Prime features higher damage across the board, and a slightly higher status chance, making it a direct upgrade from the standard Burston. Like the standard Burston, the Burston Prime features the signature three-round burst mechanic, making it difficult for some Tenno to use, but rewarding if one can learn the patterns.','http://warframe.wikia.com/wiki/Burston_Prime',NULL,12,2000,NULL,15,28),('54a73e65e779893a797fff3b','Burston Prime Receiver','The Burston Prime is the prime variant of the Burston. Compared to its predecessor, the Burston Prime features higher damage across the board, and a slightly higher status chance, making it a direct upgrade from the standard Burston. Like the standard Burston, the Burston Prime features the signature three-round burst mechanic, making it difficult for some Tenno to use, but rewarding if one can learn the patterns.','http://warframe.wikia.com/wiki/Burston_Prime',NULL,12,2000,NULL,15,28),('54a73e65e779893a797fff3c','Burston Prime Stock','The Burston Prime is the prime variant of the Burston. Compared to its predecessor, the Burston Prime features higher damage across the board, and a slightly higher status chance, making it a direct upgrade from the standard Burston. Like the standard Burston, the Burston Prime features the signature three-round burst mechanic, making it difficult for some Tenno to use, but rewarding if one can learn the patterns.','http://warframe.wikia.com/wiki/Burston_Prime',NULL,12,2000,NULL,15,28),('54a73e65e779893a797fff3d','Dakra Prime Blade','The Dakra Prime is a standalone prime melee weapon which was added to the game in Update 10.0.','http://warframe.wikia.com/wiki/Dakra_Prime',NULL,6,2000,NULL,65,89),('54a73e65e779893a797fff3e','Dakra Prime Blueprint','The Dakra Prime is a standalone prime melee weapon which was added to the game in Update 10.0.',