ases the  Impact damage of melee weapons. ','http://warframe.wikia.com/wiki/Primed_Heavy_Trauma','legendary',NULL,1000000,10,NULL,NULL),('54c686dce7798913e1a86565','Primed Heated Charge','Primed Heated Charge is the Primed version of the Heated Charge mod, which adds  Heat damage to secondary weapons.  ','http://warframe.wikia.com/wiki/Primed_Heated_Charge','legendary',NULL,1000000,10,NULL,NULL),('54c686fee7798913eda0615b','Prisma Gorgon','The Prisma Gorgon is a variant of the Gorgon light machine gun that features a unique Prisma skin and modified stats, which dependent on current trades, can be temporarily available from the Void Trader, Baro Ki\'Teer. Like its predecessor, the Prisma Gorgon sports a sizable magazine size with a high rate of fire, offset by the spooling time and long reload time. Notably, the Prisma Gorgon grants higher magazine and ammo reserve values along with its other boosted stats over its predecessor.','http://warframe.wikia.com/wiki/Prisma_Gorgon',NULL,11,2000,NULL,NULL,NULL),('54c688a2e77989145e6d0aa0','Astral Twilight','Astral Twilight is one of two available Stance mods for Glaive-type weapons, featuring highly mobile spins and sweeping slashes. ','http://warframe.wikia.com/wiki/Astral_Twilight','rare',NULL,8000,3,NULL,NULL),('54ca39abe7798915c1c11e10','Creeping Bullseye','The Creeping Bullseye mod increases the critical hit chance by 8% per rank while reducing the Fire Rate by -6% per rank of pistols for a maximum of 48% critical hit chance and -36% fire rate at rank 5.','http://warframe.wikia.com/wiki/Creeping_Bullseye','rare',NULL,8000,5,NULL,NULL),('54ca4260e7798919a4e9b429','High Noon','High Noon is a Stance mod for gunblades, blending swift slashes with gunshots. ','http://warframe.wikia.com/wiki/High_Noon','rare',NULL,8000,3,NULL,NULL),('54ca431ce779891a1adb4901','Wyrm Prime Blueprint','Wyrm Prime is the first Prime Sentinel, a version of Wyrm featuring Orokin styling and modified stats.','http://warframe.wikia.com/wiki/Wyrm_Prime',NULL,NULL,4000,NULL,15,72),('54ca4329e779891a21d036bd','Wyrm Prime Cerebrum','Wyrm Prime is the first Prime Sentinel, a version of Wyrm featuring Orokin styling and modified stats.','http://warframe.wikia.com/wiki/Wyrm_Prime',NULL,NULL,4000,NULL,15,72),('54ca4330e779891a286a5428','Wyrm Prime Carapace','Wyrm Prime is the first Prime Sentinel, a version of Wyrm featuring Orokin styling and modified stats.','http://warframe.wikia.com/wiki/Wyrm_Prime',NULL,NULL,4000,NULL,15,72),('54ca4337e779891a2e3fbc83','Wyrm Prime Systems','Wyrm Prime is the first Prime Sentinel, a version of Wyrm featuring Orokin styling and modified stats.','http://warframe.wikia.com/wiki/Wyrm_Prime',NULL,NULL,4000,NULL,45,72),('54d4c727e77989281cc7d753','Mutalist Alad V Assassinate Key','The Mutalist Alad V Assassinate Key is built from a blueprint awarded upon completion of the Patient Zero quest. The blueprint is reusable. Mutalist Nav Coordinates can be acquired as Battle Pay rewards from Infestation Outbreak and Orokin Derelict Survival/Defense missions and resource caches from hive sabotage. Upon using the key, the cell will be taken to an Infested Ship on Eris where they must face Mutalist Alad V.','http://warframe.wikia.com/wiki/Mutalist_Alad_V_Assassinate_Key',NULL,NULL,NULL,NULL,NULL,NULL),('54d4c752e77989282cc8b0a0','Mutalist Nav Coordinates','Nav Coordinates are Pickups similar to Energy orbs though darker and with a \"space\" effect inside. They can be commonly found inside storage containers and lockers on every level, inclusive of the Orokin Void or rarely be dropped by Eximi, Feral Kubrows, and Drahks. Five of them are required to craft each Orokin Derelict key, except Assassination keys.','http://warframe.wikia.com/wiki/Mutalist_Nav_Coordinates',NULL,NULL,NULL,NULL,NULL,NULL),('54d4c7eae779892855c69de9','Proof Fragment','Proof Fragments are quest items required to construct the Limbo Theorem key (not to be confused with the quest key). They can be obtained by killing the enemies