LL,NULL,NULL),('5615432bb66f8371035bfa22','Contagion Cloud','Contagion Cloud is a Warframe Augment Mod for Saryn that makes melee kills made with Toxic Lash leave behind a gas cloud that deals  Toxin damage to enemies within it for 12 seconds.','http://warframe.wikia.com/wiki/Contagion_Cloud','rare',NULL,8000,3,NULL,NULL),('5615432bb66f8371035bfa23','Calculated Shot','Calculated Shot  is a Precept mod for the Diriga Sentinel that allows it to engage enemies within sight with a long-range shot. Keep in mind that Diriga will use this ability regardless of the weapon equipped, which has interesting consequences when using Sweeper or Burst Laser.  ','http://warframe.wikia.com/wiki/Calculated_Shot','common',NULL,2000,5,NULL,NULL),('5615432bb66f8371035bfa25','Arc Coil','Arc Coil allows Diriga to zap multiple enemies within range, with a chance to stun. It has 10m range and does 100  Electricity damage. ','http://warframe.wikia.com/wiki/Arc_Coil','common',NULL,2000,5,NULL,NULL),('5615432bb66f8371035bfa26','Chaos Sphere','Chaos Sphere is a Warframe Augment Mod for Nyx that allows Chaos to create a circular radius that affects enemies entering within its range for a fraction of its duration. ','http://warframe.wikia.com/wiki/Chaos_Sphere','rare',NULL,8000,3,NULL,NULL),('5615432bb66f8371035bfa27','Hysterical Fixation','Hysterical Fixation is a PvP-exclusive Warframe Augment Mod for Valkyr\'s Hysteria that replenishes a percentage of your shields for every kill while in Hysteria.  ','http://warframe.wikia.com/wiki/Hysterical_Fixation','rare',NULL,8000,3,NULL,NULL),('5615432bb66f8371035bfa2a','Sonic Fracture','Sonic Fracture is a Warframe Augment Mod for Banshee\'s Sonic Boom that allows it to temporarily strip armor off enemies.','http://warframe.wikia.com/wiki/Sonic_Fracture','rare',NULL,8000,3,NULL,NULL),('5615432bb66f8371035bfa2b','Defiled Reckoning','Defiled Reckoning is a PvP-exclusive Warframe Augment Mod for Oberon\'s Reckoning that makes Health Orbs created by kills from Reckoning temporarily invisible to, and unusable by, enemies. ','http://warframe.wikia.com/wiki/Defiled_Reckoning','rare',NULL,8000,3,NULL,NULL),('5615432bb66f8371035bfa2c','Fast Deflection','Fast Deflection increases the Shield recharge rate of a Warframe. It has no effect on the recharge delay. ','http://warframe.wikia.com/wiki/Fast_Deflection','uncommon',NULL,4000,5,NULL,NULL),('5615432bb66f8371035bfa2d','Electro Pulse','Electro Pulse allows the Diriga sentinel to repeatedly stun a single enemy within range using  Electricity status effect .','http://warframe.wikia.com/wiki/Electro_Pulse','common',NULL,2000,5,NULL,NULL),('5615432bb66f8371035bfa2e','Neutralize','Neutralize is a Kubrow exclusive mod that allows the Chesa Kubrow to disarm enemies.','http://warframe.wikia.com/wiki/Neutralize','rare',NULL,8000,5,NULL,NULL),('5615432bb66f8371035bfa2f','Staggering Shield','Staggering Shield is a Warframe Augment Mod for Mesa that gives shots reflected by Shatter Shield a chance to stagger enemies.','http://warframe.wikia.com/wiki/Staggering_Shield','rare',NULL,8000,3,NULL,NULL),('5615432bb66f8371035bfa30','Purifying Flames','Purifying Flames is a PvP Warframe Augment Mod for Ember\'s Fire Blast that causes allies who enter the fire to have debuffs removed. ','http://warframe.wikia.com/wiki/Purifying_Flames','rare',NULL,8000,3,NULL,NULL),('5615432bb66f8371035bfa32','Retrieve','Retrieve is a Kubrow exclusive mod that allows the Chesa Kubrow to retrieve items.','http://warframe.wikia.com/wiki/Retrieve','common',NULL,2000,5,NULL,NULL),('5615432cb66f8371035bfa33','Cataclysmic Continuum','Cataclysmic Continuum is a Warframe Augment Mod for Limbo that extends Cataclysm\'s duration for every enemy killed inside it. This mod does not increase the duration beyond the maximum duration of Cataclysm, and the added seconds do not increase the Cataclysm\'s size.','http://warframe.wikia.com/wiki/Cataclysmic_Continuum','rare',NULL,8000,3,NULL,NULL),('5615432cb66f8371035bfa34','Hallowed Reckoning','Hallowed Reckoning is a Warframe Augment Mod for Oberon that makes enemies damaged by Reckoning create fields of Hallowed Ground that deal damage-over-time to enemies standing in them, while providing armor to allies.','http://warframe.wikia.com/wiki/Hallowed_Reckoning','rare',NULL,8000,3,NULL,NULL),('563893fcb66f83093e823472','Primed Target Cracker','Primed Target Cracker is the Primed version of Target Cracker, which increases the critical damage of Pistols. ','http://warframe.wikia.com/wiki/Primed_Target_Cracker','legendary',NULL,1000000,10,NULL,NULL),('56463b04b66f83585da94c6a','Corpus Void Key','Corpus Void Key is a special key only available during the Arid Fear Event. When used it will start a special Orokin Void mission taking place on a Corpus Ship. It serves no purpose beyond that event.','http://warframe.wikia.com/wiki/Corpus_Void_Key',NULL,NULL,NULL,NULL,NULL,NULL),('56463c24b66f8358acce4451','Arcane Fury','Arcane Fury is an Arcane Enhancement that provides a chance upon delivering a critical Hit to increase Melee Damage for  a short time. ','http://warframe.wikia.com/wiki/Arcane_Fury','rare',NULL,8000,3,NULL,NULL),('5655c48eb66f832e0427152e','Defiled Snapdragon','Defiled Snapdragon is a Stance Mod for Blade and Whip type weapons.','http://warframe.wikia.com/wiki/Defiled_Snapdragon','rare',NULL,8000,3,NULL,NULL),('5655c4b3b66f832e11abd3fb','Primed Shotgun Ammo Mutation','Primed Shotgun Ammo Mutation is the Primed version of the Shotgun Ammo Mutation mod for shotguns, which converts any unused ammo type into Shotgun Ammo. The affected shotgun will only convert ammo while equipped, and will not convert any ammo type used by holstered secondary weapons until their own ammo is full.','http://warframe.wikia.com/wiki/Primed_Shotgun_Ammo_Mutation','legendary',NULL,1000000,10,NULL,NULL),('5655c4c7b66f832e1ad87d50','Primed Rifle Ammo Mutation','Primed Rifle Ammo Mutation is the Primed version of the Rifle Ammo Mutation mod for assault rifles, which converts any unused ammo type into Rifle Ammo. The affected rifle will only convert ammo while equipped, and will not convert any ammo type used by holstered secondary weapons until their own ammo is full.','http://warframe.wikia.com/wiki/Primed_Rifle_Ammo_Mutation','legendary',NULL,1000000,10,NULL,NULL),('5655c4e5b66f832e25b8ce7b','Primed Morphic Transformer','Primed Morphic Transformer is the primed version of the Morphic Transformer mod, which increases the Power Strength of Archwing abilities.  ','http://warframe.wikia.com/wiki/Primed_Morphic_Transformer','legendary',NULL,1000000,10,NULL,NULL),('566750375dcbc186f0536bce','Arcane Aegis','Arcane Aegis is an Arcane Enhancement that provides a chance whenever the player receives damage to regenerate Warframe Shield for a short time.','http://warframe.wikia.com/wiki/Arcane_Aegis','rare',NULL,8000,3,NULL,NULL),('566750e45dcbc186f0536bcf','Arcane Arachne','Arcane Arachne is an Arcane Enhancement that provides a chance whenever the player wall latches to increase damage for the next hit on an enemy.','http://warframe.wikia.com/wiki/Arcane_Arachne','rare',NULL,8000,3,NULL,NULL),('5667510e5dcbc186f0536bd0','Arcane Consequence','Arcane Consequence is an Arcane Enhancement that provides a chance whenever the player upon achieving a headshot to increase Wall Latch and Aim Glide for a short time. ','http://warframe.wikia.com/wiki/Arcane_Consequence','common',NULL,2000,3,NULL,NULL),('566751295dcbc186f0536bd1','Arcane Energize','Arcane Energize is an Arcane Enhancement that provides a chance to replenish additional energy for you and nearby allies whenever an Energy Orb is picked up.','http://warframe.wikia.com/wiki/Arcane_Energize','legendary',NULL,1000000,3,NULL,NULL),('5667516b5dcbc186f0536bd2','Arcane Momentum','Arcane Momentum is an Arcane Enhancement that provides a chance to increase the Fire Rate on Sniper-type weapons whenever the player achieves a critical Hit.','http://warframe.wikia.com/wiki/Arcane_Momentum','commo