 rifle, offered as a reward for players who participated in the Operation: Tubemen of Regor Event with Alad V victorious. Its blueprint and components can also occur as Invasion rewards.','http://warframe.wikia.com/wiki/Karak_Wraith',NULL,7,2000,NULL,NULL,102),('5667576ddb7c7a568a8d45bf','Madurai Lens','Focus Abilities can be upgraded through the use of Focus Points, which are earned through the use of a Focus Lens, a special item that converts 1.25% of Affinity earned to Focus Points, before allocating the points to either Warframe only, or split between Warframe and weapon when using a weapon. Focus Lenses can only be installed on Rank 30 Warframes, Weapons, Archwings, and Archwing weapons. Only excess experience points gained after Rank 30 is converted to Focus points; if a Focus Lens-equipped item is polarized, the item will not convert Focus points until it has once again reached Rank 30. Items can only have one Focus Lens installed at any time; while players can install another Focus Lens over the old one, the previously installed Lens will be lost in the process. ','http://warframe.wikia.com/wiki/Focus_Lens',NULL,NULL,2000,NULL,NULL,NULL),('5667576ddb7c7a568a8d45c0','Vazarin Lens','Focus Abilities can be upgraded through the use of Focus Points, which are earned through the use of a Focus Lens, a special item that converts 1.25% of Affinity earned to Focus Points, before allocating the points to either Warframe only, or split between Warframe and weapon when using a weapon. Focus Lenses can only be installed on Rank 30 Warframes, Weapons, Archwings, and Archwing weapons. Only excess experience points gained after Rank 30 is converted to Focus points; if a Focus Lens-equipped item is polarized, the item will not convert Focus points until it has once again reached Rank 30. Items can only have one Focus Lens installed at any time; while players can install another Focus Lens over the old one, the previously installed Lens will be lost in the process. ','http://warframe.wikia.com/wiki/Focus_Lens',NULL,NULL,2000,NULL,NULL,NULL),('5667576ddb7c7a568a8d45c1','Zenurik Lens','Focus Abilities can be upgraded through the use of Focus Points, which are earned through the use of a Focus Lens, a special item that converts 1.25% of Affinity earned to Focus Points, before allocating the points to either Warframe only, or split between Warframe and weapon when using a weapon. Focus Lenses can only be installed on Rank 30 Warframes, Weapons, Archwings, and Archwing weapons. Only excess experience points gained after Rank 30 is converted to Focus points; if a Focus Lens-equipped item is polarized, the item will not convert Focus points until it has once again reached Rank 30. Items can only have one Focus Lens installed at any time; while players can install another Focus Lens over the old one, the previously installed Lens will be lost in the process. ','http://warframe.wikia.com/wiki/Focus_Lens',NULL,NULL,2000,NULL,NULL,NULL),('5667576ddb7c7a568a8d45c2','Naramon Lens','Focus Abilities can be upgraded through the use of Focus Points, which are earned through the use of a Focus Lens, a special item that converts 1.25% of Affinity earned to Focus Points, before allocating the points to either Warframe only, or split between Warframe and weapon when using a weapon. Focus Lenses can only be installed on Rank 30 Warframes, Weapons, Archwings, and Archwing weapons. Only excess experience points gained after Rank 30 is converted to Focus points; if a Focus Lens-equipped item is polarized, the item will not convert Focus points until it has once again reached Rank 30. Items can only have one Focus Lens installed at any time; while players can install another Focus Lens over the old one, the previously installed Lens will be lost in the process. ','http://warframe.wikia.com/wiki/Focus_Lens',NULL,NULL,2000,NULL,NULL,NULL),('5667576ddb7c7a568a8d45c3','Unairu Lens','Focus Abilities can be upgraded through the use of Focus Points, which are earned through the use of a Focus Lens, a special item that converts 1.25% of Affinity earned to Focus Points, before allocating the points to either Warframe only, or split between Warframe and weapon when using a weapon. Focus Lenses can only be installed on Rank 30 Warframes, Weapons, Archwings, and Archwing weapons. Only excess experience points gained after Rank 30 is converted to Focus points; if a Focus Lens-equipped item is polarized, the item will not convert Focus points until it has once again reached Rank 30. Items can only have one Focus Lens installed at any time; while players can install another Focus Lens over the old one, the previously installed Lens will be lost in the process. ','http://warframe.wikia.com/wiki/Focus_Lens',NULL,NULL,2000,NULL,NULL,NULL),('566759c8db7c7a568a8d45c4','Agility Drift','Agility Drift is a rare dual-stat Exilus mod that reduces damage taken while airborne and reduces enemy accuracy when targeting the player.[1]','http://warframe.wikia.com/wiki/Agility_Drift','rare',NULL,8000,5,NULL,NULL),('566759c8db7c7a568a8d45c5','Coaction Drift','Coaction Drift is a rare dual-stat Exilus mod that increases an Aura\'s strength and effectiveness.','http://warframe.wikia.com/wiki/Coaction_Drift','rare',NULL,8000,5,NULL,NULL),('566759c8db7c7a568a8d45c6','Cunning Drift','Cunning Drift is a rare triple-stat Exilus mod that increases slide, reduces friction and increases Power Range.','http://warframe.wikia.com/wiki/Cunning_Drift','rare',NULL,8000,5,NULL,NULL),('566759c8db7c7a568a8d45c7','Endurance Drift','Endurance Drift is a rare dual-stat Exilus mod that increases Maximum Energy and parkour velocity.','http://warframe.wikia.com/wiki/Endurance_Drift','rare',NULL,8000,5,NULL,NULL),('566759c8db7c7a568a8d45c8','Power Drift','Power Drift is a rare dual-stat Exilus mod that increases Power Strength and grants a chance to resist knockdown.','http://warframe.wikia.com/wiki/Power_Drift','rare',NULL,8000,5,NULL,NULL),('566759c8db7c7a568a8d45c9','Speed Drift','Speed Drift is a rare dual-stat Exilus mod that increases sprint speed and casting speed.','http://warframe.wikia.com/wiki/Speed_Drift','rare',NULL,8000,5,NULL,NULL),('566759c8db7c7a568a8d45ca','Stealth Drift','Stealth Drift is a rare dual-stat Exilus mod that increases enemy detection on the minimap and Aim Glide and Wall Latch time.','http://warframe.wikia.com/wiki/Stealth_Drift','rare',NULL,8000,5,NULL,NULL),('56783f24cbfa8f0432dd898d','Akbronco Prime Set','The Akbronco Prime lowers  Impact damage to increase  Slash damage, while gaining increased firing rate, critical damage, status chance and magazine size. The Akbronco Prime was added into the game in Update 12.4.','http://warframe.wikia.com/wiki/Akbronco_Prime',NULL,0,2000,NULL,NULL,6),('56783f24cbfa8f0432dd898e','Ankyros Prime Set','The Ankyros Prime are the primed version of Ankyros, added in Update 12.4.','http://warframe.wikia.com/wiki/Ankyros_Prime',NULL,0,2000,NULL,NULL,35),('56783f24cbfa8f0432dd898f','Ash Prime Set','Release Date: July 7, 2015Ash Prime is the primed variant of the Ash Warframe featuring more powerful stats, possessing a higher shield capacity, armor and sprint speed, as well as an additional  polarity.','http://warframe.wikia.com/wiki/Ash/Prime',NULL,NULL,4000,NULL,NULL,49),('56783f24cbfa8f0432dd8990','Bo Prime Set','The Bo Prime is the primed variant of the Bo staff. It was added in Update 13.7, featuring higher damage and an additional  polarity.','http://warframe.wikia.com/wiki/Bo_Prime',NULL,5,2000,NULL,NULL,8),('56783f24cbfa8f0432dd8991','Boar Prime Set','The Boar Prime is an ancient Orokin automatic shotgun that serves as an upgraded version of the Boar. The Boar Prime further improves on the strengths of the Boar, focusing on a high rate of fire, spread, and magazine capacity, on top of improving overall damage. This gives the Boar Prime extremely high damage per second, mitigated only by the short-comings of its predecessor, with its inability to effectively engage targets 