ime Set','The primed version of the Vasto revolver, the Vasto Prime features enhanced damage over the original.','http://warframe.wikia.com/wiki/Vasto_Prime',NULL,10,2000,NULL,NULL,107),('56783f24cbfa8f0432dd89b1','Vectis Prime Set','The Vectis Prime is the prime version of the Vectis sniper rifle. Featuring higher base damage and a doubled magazine, the Vectis Prime retains the standard version\'s 4x zoom setting, but swaps the Vectis\' 3x zoom for a much higher 10x zoom, allowing for both medium and long range combat.','http://warframe.wikia.com/wiki/Vectis_Prime',NULL,14,2000,NULL,NULL,43),('56783f24cbfa8f0432dd89b2','Volt Prime Set','Release Date: March 24th, 2015Volt Prime is the primed variant of the Volt Warframe featuring more powerful stats: possessing a higher energy capacity and armor, as well as an additional  polarity.','http://warframe.wikia.com/wiki/Volt/Prime',NULL,NULL,4000,NULL,NULL,47),('56783f24cbfa8f0432dd89b3','Wyrm Prime Set','Wyrm Prime is the first Prime Sentinel, a version of Wyrm featuring Orokin styling and modified stats.','http://warframe.wikia.com/wiki/Wyrm_Prime',NULL,NULL,4000,NULL,NULL,72),('567872239906166591f69a9a','Madurai Transmute Core','Madurai Transmute Core is a special Core that can be used as an ingredient in Transmutation. When transmuted alongside other Mods, the core ensures that the resulting Mod will be of  Madurai Polarity. Using a Transmutation Core also removes the credit cost for that transmutation, allowing for cheaper attempts at transmuting Rare-quality Mods. Transmutation Cores do not guarantee the rarity of the resulting mod, only their polarity.','http://warframe.wikia.com/wiki/Madurai_Transmute_Core','rare',NULL,2000,NULL,NULL,NULL),('567872299906166591f69a9b','Naramon Transmute Core','Naramon Transmutate Core is a special Core that can be used as an ingredient in Transmutation. When transmuted alongside other Mods, the core ensures that the resulting Mod will be of  Naramon Polarity. Using a Transmutation 