 Warframe Augment Mod for Wukong\'s Cloud Walker that gives allies near the cloud temporary invisiblity.','http://warframe.wikia.com/wiki/Enveloping_Cloud','rare',NULL,8000,3,NULL,NULL),('5b91784d0566c80216658cea','Accumulating Whipclaw','Accumulating Whipclaw is a Warframe Augment Mod for Khora\'s Whipclaw. Hitting 3 enemies will grant a stackable Damage Bonus to subsequent Whipclaws, which will decay after 10 seconds.','http://warframe.wikia.com/wiki/Accumulating_Whipclaw','rare',NULL,8000,3,NULL,NULL),('5ba4fde94567de006211ae6d','Primed Charged Shell','Primed Charged Shell is the Primed version of the Charged Shell mod, that increases Electricity b Electricity damage of Shotguns by 15% per rank for a maximum of 165% at rank 10.','http://warframe.wikia.com/wiki/Primed_Charged_Shell','legendary',NULL,1000000,10,NULL,NULL),('5ba9f2014567de01415f6387','Chroma Prime Systems','Release Date: September 25th, 2018Chroma Prime is the Primed variant of Chroma, possessing increased armor and energy capacity over the regular counterpart.','http://warframe.wikia.com/wiki/Chroma/Prime',NULL,0,4000,NULL,100,61),('5ba9f2024567de01415f6388','Chroma Prime Chassis','Release Date: September 25th, 2018Chroma Prime is the Primed variant of Chroma, possessing increased armor and energy capacity over the regular counterpart.','http://warframe.wikia.com/wiki/Chroma/Prime',NULL,0,4000,NULL,45,61),('5ba9f2024567de01415f6389','Chroma Prime Neuroptics','Release Date: September 25th, 2018Chroma Prime is the Primed variant of Chroma, possessing increased armor and energy capacity over the regular counterpart.','http://warframe.wikia.com/wiki/Chroma/Prime',NULL,0,4000,NULL,100,61),('5ba9f2034567de01415f638a','Sahasa Kubrow Imprint','Enterprising Orokin genetic designers recognized that the Kubrow\'s affinity for games of fetch could be used for more serious endeavors. They soon developed a strain adept at reconnaissance and contraband recovery. Tenno often used the creatures to help resupply while in the field.','http://warframe.wikia.com/wiki/Kubrow#Sahasa',NULL,NULL,4000,NULL,NULL,NULL),('5ba9f2034567de01415f638b','Chroma Prime Set','Release Date: September 25th, 2018Chroma Prime is the Primed variant of Chroma, possessing increased armor and energy capacity over the regular counterpart.','http://warframe.wikia.com/wiki/Chroma/Prime',NULL,0,20000,NULL,NULL,61),('5ba9f2034567de01415f638c','Smeeta Kavat Imprint','This sly feline is playful yet devious.','http://warframe.wikia.com/wiki/Kavat#Smeeta%20Kavat',NULL,NULL,4000,NULL,NULL,NULL),('5ba9f2044567de01415f638d','Sunika Kubrow Imprint','Once the value of Orokin guard-pets had been realized, it was not long after the Orokin guard began experimenting with strains designed for combat. These were no longer household pets but superior war animals bred for ferocity and aggression.','http://warframe.wikia.com/wiki/Kubrow#Sunika',NULL,NULL,4000,NULL,NULL,NULL),('5ba9f2044567de01415f638e','Huras Kubrow Imprint','Prized for its ability to sneak up on unsuspecting prey, the Huras Kubrow were first used as hunting companions by the Orokin elite. Orokin Era Tenno soon adapted the strain for use in covert missions and assassinations.','http://warframe.wikia.com/wiki/Kubrow#Huras',NULL,NULL,4000,NULL,NULL,NULL),('5ba9f2044567de01415f638f','Raksa Kubrow Imprint','Designed by the Orokin to be the perfect companion, a Kubrow was never far from its master\'s side. Loyal and obedient, these creatures made ideal bodyguards. Equipped with shield generators for added protection, their fierce growl could paralyze any attacker with fear.','http://warframe.wikia.com/wiki/Kubrow#Raksa',NULL,NULL,4000,NULL,NULL,NULL),('5ba9f2054567de01415f6390','Chroma Prime Blueprint','Release Date: September 25th, 2018Chroma Prime is the Primed variant of Chroma, possessing increased armor and energy capacity over the regular counterpart.','http://warframe.wikia.com/wiki/Chroma/Prime',NULL,0,4000,NULL,15,61),('5ba9f2054567de01415f6391','Adarza Ka